import React from 'react'
import Header from '../../components/Header';
import Banner from '../../components/UI/Banner';
import GetIdea from './getIdea';
import Subscribe from './Subscribe';

const Contact = () => {
    return (
        <>
            <Header Page={'contact'} />
            <main>
                {/*BANNER */}
                <Banner Page={'contact'}/>
                {/*/.END BANNER*/}

                {/*SUBMIT IDEA */}
                <GetIdea />
                {/*/.END SUBMIT IDEA*/}
                
                {/* SUBSCRIBE */}
                <Subscribe />
                {/*END SUBSCRIBE*/}
            </main>
        </>

    )
}

export default Contact;
